    <script>
      var map; //map object
      function initMap() {
      	var infowindow = new google.maps.InfoWindow;

	  center: new google.maps.LatLng(40.513348, -75.777088), //should be set to client's closest location

	/* *********************************************** */
	/* CREATING THE FINAL DATA STRUCTURE FROM THE JSON  */
	/* *********************************************** */
	/* */
	//this array is for the spawn objects, derived from the json
	var spawns =[{"spawnId":"89c5d3b77b3","minute":['48'],"lat":40.509036210058866,"lng":-75.78007127959665,"pokemon":[{"id":116,"count":1}]}];
	//looping though all the items in the raw spawnList
 	for (var i = 0; i < spawnList.length; i++) { 
		//date object for each new record 
		//to update spawn time if it is sooner in the hour
		//otherwise, ditch or add to new record
		var spawnDate = new Date(spawnList[i]['time'] * 1000);
		var minutes = spawnDate.getMinutes();
		var oldSpawn=0;

		for (var j = 0; j < spawns.length && !oldSpawn; j++) { 
		//check if the current spawnId in the raw spawnList matches a previous record in the spawn array
		//if it matches a previous spawn, compare the mons to stack the mons
			if(spawnList[i]['spawnId']==spawns[j]['spawnId']){ //a previous spawn point
				oldSpawn=1;
				var found = 0; //variable to set if pokemon matches a previous pokemon at spawnpoint
				for (var k = 0; k < spawns[j]['pokemon'].length && !found; k++) { //loops the length of array or until it is found
					if(found==0 && spawns[j]['pokemon'][k]['id'] == spawnList[i]['pokemonId']){
						spawns[j]['pokemon'][k]['count']+=1; //stacking the mons with their count variable
						found=1;
					}
				}//end of search for a matching pokemon at the spawnpoint
				if(!found) //pokemon was not found in spawnpoint record's pokemon list but the spawn point is a duplicate
					spawns[j]['pokemon'].push({"id":spawnList[i]['pokemonId'],"count":1});

				//updates minute array
				var minuteRecorded = 0;
				//searches minute array in case of repeating minute
				for(var k = 0; k < spawns[j]['minute'].length && !minuteRecorded; k++)
					minuteRecorded = (minutes==spawns[j]['minute'][k]);	
				//pushes new minute onto minute arrray
				if(!minuteRecorded) //spawn was found at a new time
					spawns[j]['minute'].push((minutes<10)?String("0"+minutes):String(minutes));	
			}
		}//end of search for a matching spawnpoint
		if(!oldSpawn) //spawn point is new. push it
			spawns.push({"spawnId":spawnList[i]['spawnId'],
			"minute":[(minutes<10)?String("0"+minutes):String(minutes)],
			"lat":spawnList[i]['lat'],
			"lng":spawnList[i]['lng'],
			"pokemon":[{"id":spawnList[i]['pokemonId'],"count":1}]
			});
	} //end of search through spawnList records
	/*  */
	/* ****************************** */
	/* END OF DATA STRUCTURE CREATION */
	/* ****************************** */
	
	//OUTPUT THE DATA STRUCTURE TO DEVELOPERS CONSOLE
	//console.log(JSON.stringify(spawns));
	//number of unique spawn points recorded
	//console.log(spawns.length);
	//a data structure derived from console output
	// var spawns = a very large object, just output a new one if you want it
	// (this was not any faster because of my damn i7, thanks intel)
	
	//only 1 object for marker boxes so that when you click on a new one, the old one deletes
	var marker;

	for (var i = 0; i < spawns.length; i++) {

		var marker = new google.maps.Marker({

		google.maps.event.addListener(marker, 'click', (function(marker, i,infowindow) {

		        // centers map on last placed marker object
			//indexMap.setCenter(new google.maps.LatLng(spawnList[i]['lat'], spawnList[i]['lng']));

			var contentString = '<div id="content">'+
			'<p>('+spawns[i]['lat']+', '+ spawns[i]['lng']+')</p>Detected at';
			
			//sorts the recorded spawn times
			spawns[i]['minute']=spawns[i]['minute'].sort();
			
			//just for test purposes, only test range algorithm on an array of 5 or more minutes
			/*if (spawns[i]['minute'].length>=5){
				//range algorithm
				var l,r=spawns[i]['minute'][0];//set left and right to first minute
				for( var j = 1; j< spawns[i]['minute'].length;j++){
					if(spawns[i]['minute'][0]-14>=r){
					//if thre is a 14 minute or less gap between the spawn times
					}
				}
				}*/
			
			
			//places all times into the contentString for output (raw text, no returns)
			for( var j = 0; j < spawns[i]['minute'].length; j++)
				contentString+=' :'+spawns[i]['minute'][j];

			//table of pokemon images with spawn count
			contentString+='<table><tr>';
			for( var j = 0; j < spawns[i]['pokemon'].length; j++){
				//image of pokemon
				contentString+='<td><img src="'+String("icons/"+spawns[i]['pokemon'][j]['id']+".png")+'"></td>';
				//displays count
				pokeNumber+=spawns[i]['pokemon'][j]['count'];
				contentString+='<td><p> X'+String(spawns[i]['pokemon'][j]['count'])+'</p></td>';
				//5 images per row
				//gotta j+1 or it'll break j=0
				if((j+1)%5==0) contentString+='</tr><tr>'; 
			}
			contentString+='</table></div>';
			//end of pokemon table
			infowindow.setContent(contentString);
			infowindow.open(map, marker);
		     }
		})(marker, i,infowindow));
	}
